import React, { Component } from 'react'

 class HOC extends Component {
     constructor(props){
        super(props);
        {
            this.state={
                count:0
            }
        }
     }

    handleClick=()=>{
        alert("this is HOC");
    }

    render() {
        return (
            <div>
                <button onClick={this.handleClick}>HOC</button>
            </div>
        )
    }
}
export default HOC;
